import React, { Component } from 'react';

class AddForm extends Component {

    render() {
        return (
            <form className="mt-3">
                <div className="form-group">
                    <label htmlFor="exampleInputEmail1">Tiêu đề</label>
                    <input type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Tiêu đề" />
                </div>
                <div className="form-group">
                    <label htmlFor="exampleInputPassword1">Nội dung</label>
                    <input type="text" className="form-control" id="exampleInputPassword1" placeholder="Nội dung" />
                </div>
                <button type="submit" className="btn btn-primary">Thêm</button>
            </form>

        );
    }
}

export default AddForm;
